window.bookSummaryJSON = "<p><b>The </b><b><i>New York Times</i></b><b> and </b><b><i>USA Today </i></b><b>best-selling series. </b></p> <p><b>Humanity has finally found a new home, but the price is blood....</b></p> <p>After a long, perilous journey, Hell Divers Xavier Rodriguez and Magnolia Katib discover the Metal Islands, a sunny, habitable zone where thousands of people live by fishing and farming. But this \"paradise\" is really a violent warrior society ruled by the cannibal King el Pulpo. For the first time in X's life, he is forced to lay down his arms and surrender.&nbsp;</p> <p>Back on the airships, the Hell Divers are recovering from a gruesome discovery at Red Sphere, where they learned the truth about World War III. Now, they must fight another war - this time for what remains of their own endangered species. As the battle approaches, alliances will be forged and others broken.&nbsp;</p> <p>Forced to fight in the Cazador army, X faces his toughest mission yet. Will he help his people come down from the sky and claim the promised land, or will humanity go extinct?</p>"; 
